import React from "react";

const LandPadItem = (props) => {
  return (
    <div
      className="card bg-dark text-light my-3 "
      style={{ width: "390px", height: "450px" }}
    >
      <img
        src={props.images}
        className="card-img-top img-fluid"
        alt="..."
        style={{ height: "250px" }}
      />
      <div className="card-body">
        <h5 className="card-title">{props.name},{props.full_name}</h5>
        {/* <p>full_Name: </p> */}
        <p className="card-text text-start">{props.details.slice(0, 150)}...</p>
        <button href="#" className="btn btn-outline-primary mr-3">
          Read More
        </button>
      </div>
    </div>
  );
};
export default LandPadItem;
